function Personalinfo() {
    const info = [{ "name": "ck", "id": "1" }, { "name": "cc", "id": "2" }];

    return (<div>
        <label >a</label>
        <div>
            {Array.from(info).map(entry => {
                return <div>
                    <p>{entry.name}</p>
                    <p>{entry.id}</p>
                </div>
            })}

        </div>
    </div>);
}
export default Personalinfo;
